import React, { Component } from 'react';   

class SeriesHomeCenter extends Component {
    constructor(props) {
        super(props);
        this.state = { 
             series : [],
         }
    }
    render() {
        const { homeContents } = this.props;
        let series = homeContents.filter(x => x.type === 'series');
        this.setState({series:series});

        console.log(series);
        return (
            <div>Rendering Contents
                 {this.state.series.map(item => (
                      <div> {item.type} </div>
                 ))}
           </div>
        )
    }
}

 
export default SeriesHomeCenter;
